    for (int i = 0, len = str.length(); i < len; i++) {
        char c = str.charAt(i);
        if (c == '\\' && !escaped) {
            escaped = true;
        } else {
            if (escaped) {
                switch (c) {
                    case 't':
                        result.append('\t');
                        break;
                    case 'n':
                        result.append('\n');
