public synchronized void send(final String message){
    final Iterator iter = connections.iterator();
    while(iter.hasNext()){
        final Socket socket = (Socket)iter.next();
        if(socket.isConnected()){
            try{
                final PrintWriter writer = (PrintWriter)writers.get(connections.indexOf(socket));
                if(writer != null){
                    writer.println(message);
                    writer.flush();
                }
            }
            catch(final IOException e){
                LogLog.error("Failed to send message to " + socket, e);
            }
        }
        else{
            iter.remove();
        }
    }
}

